var setFiles = function(){
    var uploader = new plupload.Uploader({
        runtimes : 'html5,flash,silverlight,html4',
        browse_button : 'pickfiles', // you can pass an id...
        url : '/proc/common/file_upload_common.php',
        flash_swf_url : '/plupload/js/Moxie.swf',
        silverlight_xap_url : '/plupload/js/Moxie.xap',
        chunk_size: '5mb', //업로드단위 분할 사이즈
        multipart_params : {
            "order_no" : "",
            "prd_detail_no" : "",
            "type" : "",
            "ftype" : ""
        },
        max_file_count : 1,
        filters : {
            max_file_size : '1000mb',
            mime_types: [
                {title : "Image files", extensions : "jpg,gif,png"}
            ]
        },

        init: {

            PostInit: function() {
                document.getElementById('uploadfiles').onclick = function() {
                    uploader.settings.multipart_params["order_no"] = $('#fileUpload').attr('ono');
                    uploader.settings.multipart_params["prd_detail_no"] = $('#fileUpload').attr('dno');
                    uploader.settings.multipart_params["type"] = 'user';
                    uploader.settings.multipart_params["ftype"] = 'order';
                    $('#filelist').attr('fchk',false); //파일업로드중 결제진행을 못하기 위해 설정
                    uploader.start();
                    return false;
                };
            },

            FilesAdded: function(up, files) {
                $("#btn_upload").show();
                //console.log(uploader<?=$i?>.files);
                plupload.each(files, function(file) {
                    $("#uploadfiles").show();
                    if(uploader.files.length > 1){
                        uploader.files.reverse();
                        uploader.files.pop();
                    }
                    document.getElementById('filelist').innerHTML
                        = '<label id='+ file.id +'>' + file.name +' (' + plupload.formatSize(file.size) + ')<b></b>'
                    + '&nbsp;' +
                        "<img src=\"/design_template/images/btn_circle_x_red.png\"" +
                    "     id=\"work_file_del\"" +
                    "     file_seqno=\"\"" +
                    "     onclick=\"removeFile('');\"" +
                    "     style=\"cursor:pointer;\" /></label>";
                });

            },

            UploadProgress: function(up, file) {
                document.getElementById(file.id).getElementsByTagName('b')[0].innerHTML = '<span>' + file.percent + "%</span>";
            },
            FileUploaded: function(up, file, response) {
                var jsonObj = JSON.parse(response.response);
                var fileSeqno = jsonObj.id;
                $('#filelist').attr('fchk',true);
                $('#work_file_del').attr(
                    {"onclick"  : "removeUploadFile('" + fileSeqno + "');",
                        "file_seqno" : fileSeqno}
                );
            },
            Error: function(up, err) {
                alert('파일업로드가 정상적으로 이루어지지 않았습니다 \n관리자에게 문의해주세요');
            }
        }
    });
    uploader.init();
    uploaderObj = uploader;
}

var removeUploadFile = function(seqno) {
    if (confirm("기존 파일은 삭제합니다." +
            "\n계속 하시겠습니까?") === false) {
        return false;
    }

    var fileSeqno = seqno;

    removeFile(fileSeqno, false);
}

var removeFile = function(seqno, flag) {
    if (checkBlank(seqno) === true) {
        var uploader = uploaderObj;
        var files = uploader.files;
        uploader.removeFile(files[0]);

        return false;
    }

    if (flag === true) {
        if (confirm("작업파일을 삭제하시겠습니까?" +
                "\n삭제된 파일은 복구되지 않습니다.") === false) {
            return false;
        }
    }

    var url = "/ajax/business/esti_list/del_esti_file.php";
    var data = {
        "seqno"  : seqno
    };
    var callback = function(result) {
        if (result == "F") {
            alert("파일 정보 삭제에 실패했습니다.");
            return false;
        }
        $("#uploadfiles").hide();
        $("#filelist").html('');

        if (flag === true) {
            var uploader = uploaderObj;
            var files = uploader.files;
            uploader.removeFile(files[0]);
        }


    };

    showMask();
    ajaxCall(url, "text", data, callback);
};

function httpRequest(){

	if(window.XMLHttpRequest){

		try{

			request = new XMLHttpRequest();

		}catch(e){

			request = null;

		}

	}else if(window.ActiveXObject){

		//* IE

		try{

			request = new ActiveXObject("Msxml2.XMLHTTP");

		}catch(e){

			//* Old Version IE

			try{

				request = new ActiveXObject("Microsoft.XMLHTTP");

			}catch(e){

				request = null;

			}

		}

	}

	request.onreadystatechange = function(){

		if(request.readyState == 4 && request.status == 200){

			var xmlData = request.getReaponseXML().getElementById("helpMsg");

			var entries = xmlData.getElementByTagName("rawurl");

		}

	}

}

