function Comma(Cost)
{
    var Rz = '';
    var Rs = '';
    var Rc = 0;
    Cost = parseInt(Cost);
    var Rh = (Cost < 0) ? 1 : 0;Cost += '';
    var CostLength = Cost.length;
    for(i = CostLength; i >= 0 ; i--)
    {
        Rz = Cost.charAt(i);
        Rs = Rz + Rs;
        if(Rc % 3 == 0 && i > Rh && i < CostLength)
        {
            Rs = ',' + Rs;
        }
        Rc++;
    }
    return (Rs);
}

function DeComma(Cost)
{
    var Rz = '';
    var Rs = '';
    if(Cost=='') Cost = 0;
    var CostLength = Cost.length;
    for(i = CostLength; i >= 0 ; i--)
    {
        Rz = Cost.charAt(i);
        if(Rz != ',')
        {
            Rs = Rz + Rs;
        }
    }
    if(Rs=='') Rs = 0;
    return (Rs);
}
